      When Total Testosterone is in the Functional High range we must first determine if this is due to overexposure to the hormone from an external source, or from an overproduction of the hormone inside the body. Exposure to Testosterone from an external source could include: 1) someone who is on a Testosterone hormone therapy as prescribed by a medical provider; 2) being in close physical contact with someone who is using a Testosterone lotion, gel or cream as part of a prescribed hormone therapy resulting in the hormone being absorbed into the skin of a second individual unintentionally; 3) the intentional intake of Testosterone as a steroid hormone for muscle building, performance enhancement, or other reasons. An abnormal overproduction of Testosterone from within the body could include testicular tumors, adrenal tumors that are producing testosterone, or pituitary tumors that are causing an overproduction of Luteinizing Hormone (LH) which signals the testicles (in men) to produce Testosterone. A Functional High level of Testosterone is abnormal and should be evaluated by a qualified healthcare provider to determine the origin of the problem if the cause is unknown to the patient."
    }

