      description: "Your result for this lab test is in the CLINICAL LOW range. Globulin is a term for all proteins in the blood that are not Albumin. Globulins are another type of “carrier protein” involved in the transport of some resources to your cells to help them function at their best. There are 4 fractions (or types) of Globulins in the blood that make up your number for Total Globulin. These 4 fractions are called: Alpha 1, Alpha 2, Beta and Gamma. Globulins are also an important part of your immune system and are critical in the formation of antibodies - also called immunoglobulins such as IgA, IgE, IgG and IgM - which are manufactured from the gamma fraction. The gamma fraction usually makes up the largest portion of the Total Globulin, so an abnormal Total Globulin would have us first thinking about some type of acute or chronic challenge to the immune system . . . but may be due to other factors as well. When Total Globulin is close to or within the Clinical High or Clinical Low ranges, an additional test called a serum protein electrophoresis should be considered to determine which fraction(s) are involved to allow for a better diagnosis.

